script: |
  super -f text -I q3266.spq | sort > q3266.out

inputs:
  - name: q3266.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) WHERE col1 NOT BETWEEN - 30 * + - 13 + col0 AND + 60 * - col2 * + col1 + col1 - - 60;
  - name: tab2

outputs:
  - name: q3266.out
    data: |
      46	51	23
      64	77	40
      75	67	58
